fromHex ('x':s) = fromHex s
fromHex s = fx (reverse s)
  where fx [] = 0
        fx (c:t) = (hd c) + 16 * fx t
        hd c    | c `elem` ['0'..'9'] = (ord c) - (ord '0')
                | c `elem` ['a'..'f'] = (ord c) - (ord 'a') + 10 
                | c `elem` ['A'..'F'] = (ord c) - (ord 'A') + 10
                | otherwise = 0

fromOctal s = fo (reverse s)
  where fo [] = 0
        fo (c:t) = (od c) + 8 * fo t
        od c    | c `elem` ['0'..'7'] = (ord c) - (ord '0')
                | otherwise = 0
                         
